import React from 'react';


function Home() {

  return (
    <div>
          <section className="card createcard">
            <div className="card-body" >
                <div className="btns">
                    <Link className="btn eventType1btn btn-secondary active"  role="button" aria-pressed="true" to="Search">
                        Search For Food
                    </Link>
                    <Link className="btn eventType1btn btn-secondary active"  role="button" aria-pressed="true" to="Add">
                        Add A Food
                    </Link>
                </div>
            </div>
            </section>
        </div>
  );
}

export default Home;
